import React, { Component } from 'react';
import Spinner from '../general/Spinner';
import './Exportar.css';
import { Link } from 'react-router-dom';
import { connect } from 'react-redux';
import axios from 'axios';
import { URL_DEFAULT } from '../../../urls/urls';

const token = window.localStorage.getItem('token');

class Exportar extends Component {



    showNet = () => {
        console.log(this.props.cargando)
        if (this.props.cargando) {
            return <Spinner />
        } else {
            if (this.props.graph != '') {
                for(let i = 0; i<= 10; i++){
                    return (
                        <div key={i} className="col s3 l3">
                            <div className="card">
                                <div className="card-image">
                                    <img src={this.props.graph.node[i].metadata.picture} />
                                    <span className="card-title">{this.props.graph.node[i].metadata.name}</span>
                                </div>
                            </div>
                        </div>
    
                    )
                }
                
            }
        }
    }

    render() {

        return (

            <div id="networks" className="row">
                <div className="col l12">
                    <div className="card-panel">
                        {this.showNet()}
                    </div>
                </div>

            </div>


        );
    }
}

export default Exportar;
